import Typography from '@material-ui/core/Typography';

const styles = {
  navigation: {
    fontSize: 15,
    fontWeight: Typography.fontWeightLight,
    color: 'grey',
    paddingBottom: 15,
    display: 'block'
  },
  title: {
    fontSize: 24,
    fontWeight: Typography.fontWeightLight,
    marginBottom: 20
  },
  paper: {
    padding: 30
  },
  clear: {
    clear: 'both'
  }
};

export default styles;
